import { Fragment } from "react/cjs/react.production.min";
import Header from "./Components/Layout/Header";
import Meals from "./Components/Meals/Meals";
import Cart from "./Components/Cart/Cart"

function App() {
  return (
    <Fragment>

     <Header/>
     <Cart/>
     <main>
       <Meals/>
     </main>
    </Fragment>
  );
}

export default App;
